// A single led:
Led = function (x, y, size) {
    return {
        getSize: function () {
            return size;
        },
        createSvg: function () {
            return SVG('rect')
                .attr('x', x)
                .attr('y', y)
                .attr('width', size)
                .attr('height', size)
                .attr('class', "led");
        }
    };
};

// Definition of a glyph:
Glyph = function (char) {
    var leds = [], pos = 1,
        width = parseFloat(char.width) * pixelSizeTot,
        height = parseFloat(char.height) * pixelSizeTot;

    for (var y = 0; y < char.height; y++) {
        for (var x = 0; x < char.width; x++) {
            if (char.data[pos] === '1') {
                leds.push(Led(
                    x * pixelSizeTot,
                    y * pixelSizeTot,
                    self.pixelSize));
            }
            pos += 2;
        }
    }
    return {
        leds: leds,
        getWidth: function () {
            return width;
        },
        getHeight: function () {
            return height;
        },
        createSvg: function () {
            var res = SVG('g')
                .attr('fill', 'orange');
            for (var i in leds) {
                res.append(leds[i].createSvg());
            }
            res.attr('height', height)
                .attr('width', width);
            return res;
        }
    };
};

// A font that can be crated from the JSON representation:
Font = function (name,data) {
    // Attributes:
    var res = {
        name: name,
        chars: []
    };
    data = JSON.parse(data);
    for (var i in data.font.glyphs.glyph) {
        var glyph = data.font.glyphs.glyph[i];
        var char = String.fromCharCode(glyph['@chr']);
        glyph = glyph.map;
        res.chars[char] = {
            width: glyph['@width'],
            height: glyph['@height'],
            type: glyph['@type'],
            data: glyph['$'],
            svgs: []
        };
    }

    // Methods:
    res.getHeight = function() {
        var g = this.getGlyph('_');
        var res = parseFloat(g.attr('height'));
        this.releaseGlyph(g);
        return res;
    };
    res.getWidth = function(name) {
        var g = this.getGlyph(name);
        var res = parseFloat(g.attr('width'));
        this.releaseGlyph(g);
        return res;
    };
    res.getGlyph = function(name) {
        // Obtaining the glyph:
        var char = this.chars[name];
        if (char.glyph === undefined) {
            // Decoding the glyph:
            char.glyph = Glyph(char);
        }

        // Lookup of an already created SVG:
        var svg;
        if (char.svgs.length > 0) {
            // Retrieving it:
            svg = char.svgs.pop();
        }
        else {
            // Creating it:
            svg = char.glyph.createSvg();

            // Adding some attributes:
            svg.attr('char', name);
        }

        // Some changes:
        svg .attr('class','char')
            .attr('font',this.name);

        // Done:
        return svg;
    };
    res.releaseGlyph = function(g) {
        // Checking:
        if (g === undefined) { return; }

        // Some changes:
        g.attr('class','char-hidden');

        // Adding it to the right character:
        this.chars[g.attr('char')].svgs.push(g);
    };

    // Done:
    return res;
};

